import React, { useEffect, useState } from "react";
import axios from "axios";
import "../styles/OrderPage.css";
import orderBg from "../img/orderbg.jpg";

const OrdersPage = () => {
  const [orders, setOrders] = useState([]);

  useEffect(() => {
    // Fetch orders from backend on mount
    const fetchOrders = async () => {
      try {
        const res = await axios.get("/api/orders");
        let ordersArr = [];
        if (Array.isArray(res.data)) {
          ordersArr = res.data;
        } else if (res.data && Array.isArray(res.data.orders)) {
          ordersArr = res.data.orders;
        } else if (res.data && res.data.data && Array.isArray(res.data.data)) {
          ordersArr = res.data.data;
        }
        setOrders(ordersArr);
      } catch (err) {
        setOrders([]);
      }
    };
    fetchOrders();
  }, []);

  const handleComplete = async (id) => {
    await axios.patch(`/api/orders/${id}`, { status: "Completed" });
    setOrders((prev) =>
      prev.map((order) =>
        order._id === id ? { ...order, status: "Completed" } : order
      )
    );
  };

  return (
    <div
      className="orders-section"
      style={{
        backgroundImage: `url('${orderBg}')`,
        backgroundRepeat: "no-repeat",
        backgroundPosition: "center 2rem",
        backgroundSize: "cover",
        alignContent: "center",
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        minHeight: "800px",
        color: "white"
      }}
    >
      <h3>Orders</h3>
      <div style={{ width: "100%", maxWidth: 700, margin: "0 auto", background: "rgba(255,255,255,0.95)", borderRadius: 10, padding: "1.5rem", color: "#333", boxShadow: "0 2px 12px rgba(0,0,0,0.07)" }}>
        <table style={{ width: "100%", borderCollapse: "collapse" }}>
          <thead>
            <tr style={{ background: "#f97316", color: "#fff" }}>
              <th style={{ padding: "0.7rem", borderRadius: "8px 0 0 0" }}>Table</th>
              <th style={{ padding: "0.7rem" }}>Items</th>
              <th style={{ padding: "0.7rem" }}>Status</th>
              <th style={{ padding: "0.7rem" }}>Mark Completed</th>
              <th style={{ padding: "0.7rem", borderRadius: "0 8px 0 0" }}>Date</th>
            </tr>
          </thead>
          <tbody>
            {orders.length === 0 && (
              <tr>
                <td colSpan={5} style={{ textAlign: "center", padding: "1.5rem" }}>No orders yet.</td>
              </tr>
            )}
            {orders.map((order) => (
              <tr key={order._id || order.id} style={{ background: order.status === "Completed" ? "#e0ffe0" : "#fff" }}>
                <td style={{ padding: "0.7rem", textAlign: "center" }}>{order.table}</td>
                <td style={{ padding: "0.7rem", textAlign: "center" }}>
                  {Array.isArray(order.items) ? order.items.join(", ") : order.items}
                </td>
                <td style={{ padding: "0.7rem", textAlign: "center" }}>{order.status}</td>
                <td style={{ padding: "0.7rem", textAlign: "center" }}>
                  {order.status !== "Completed" && (
                    <input
                      type="checkbox"
                      title="Mark as Completed"
                      onChange={() => handleComplete(order._id || order.id)}
                      style={{ width: "18px", height: "18px" }}
                    />
                  )}
                </td>
                <td style={{ padding: "0.7rem", textAlign: "center" }}>
                  {order.date
                    ? new Date(order.date).toLocaleString()
                    : order.createdAt
                    ? new Date(order.createdAt).toLocaleString()
                    : "-"}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default OrdersPage;
